  padding: 0;
  margin: 0;
}

</style><style name="masthead_shell">ytd-masthead.shell {
  display: -ms-flex;
  display: -webkit-flex;
  display: flex;
  height: 56px;
  padding: 0 16px;
  -ms-flex-align: center;
  -webkit-align-items: center;
  align-items: center;
}

ytd-masthead.shell #searchbox {
  -ms-flex: 1 1 auto;
  -webkit-flex: 1 1 auto;
  flex: 1 1 auto;
  margin: 0 40px;
}

ytd-masthead.shell #yt-logo-svg {
  align-self: center;
  margin-left: 8px;
  padding: 0;
  color: black;
}

ytd-masthead.shell svg {
  width: 40px;
  height: 40px;
  padding: 8px;
  margin-right: 8px;
  box-sizing: border-box;
  color: rgba(17, 17, 17, .4);
  fill: currentColor;
}

ytd-masthead.shell #three-dot-icon {
  margin: 8px;
}

ytd-masthead.shell #sign-in-btn a {
  color: rgb(230, 33, 33);
  font-weight: 500;
  font-size: 1.4rem;
  letter-spacing: .007px;
  text-transform: uppercase;
  text-decoration: none;
  vertical-align: middle;
  padding: 10px 16px;
  white-space: nowrap;
}

ytd-masthead.shell #search-icon {
  display: none;
}

ytd-masthead.shell #more-vert-icon {
  margin-left: 8px;
}

/** Keep these styles in sync with ytd-masthead_fn_test. */
ytd-masthead .external-icon {
  width: 24px;
  height: 24px;
}

ytd-masthead .yt-icons-ext {
  fill: currentColor;
  color: rgba(17, 17, 17, .4);
}

ytd-masthead #yt-logo-svg {
  width: 56px;
  height: 24px;
}

ytd-app > #drop-shadow {
  pointer-events: none;
  box-shadow: inset 0px 4px 8px -3px rgba(17, 17, 17, .16);
  height: 8px;
}

@media (max-width: 656px) {
  ytd-masthead.shell {
    padding: 0 8px;
  }
  ytd-masthead.shell #searchbox {
    margin: 0;
  }
  ytd-masthead.shell svg  {
    margin-right: 0;
  }
  ytd-masthead.shell #yt-logo-svg  {
    margin-left: 4px;
  }

  ytd-masthead.shell #search-icon {
    display: block;
  }

  ytd-masthead.shell #more-vert-icon {
    margin-left: 0;
  }
}
